import React from 'react'
import './style.css';

function Home() {
  return (
    <div className="section">
      <div className="top-right"></div>
      <div className="top-left"></div>
      <div className="bottom-right"></div>
      <div className="text-box">
        <h1>Test</h1>
      </div>
    </div>
  )
}

export default Home
